import React from "react";

class HomePage extends React.Component {
    constructor(props) {
        super();
    }

    render() {
        return (
            <div className="topnav">
                <a className="active" href="#home">Home</a>
                <a href="#news">News</a>
                <a href="#contact">Contact</a>
                <a href="#about">About</a>
            </div>
        );
  }
}

export default HomePage;
